using namespace std;

int binar(vector<int> &vec, int r, int vstavka){
    int l = 0;
    int mid = (l + r) / 2;
    while (true) {
        if (vstavka == vec[mid]){
            return mid;
        }
        if (vstavka > vec[mid]){
            l = mid;
            mid = (l + r) / 2;
        } else if (vstavka < vec[mid]){
            r = mid;
            mid = (l + r) / 2;
        }
        if (r - 1 == l){
            return (vec[l] > vstavka ? l : r);
        }
    }
}

void new_insertion_sort(vector<int> &vec){
    for (int i = 1; i < vec.size(); i++){
        vec.emplace(vec.begin() + binar(vec, i, vec[i]), vec[i]);
        vec.erase(vec.begin() + i + 1);
    }
}

void bubble_sort(vector<int> &vec){
    int k;
    while (true){
        if (k == vec.size() - 1){
            break;
        }
        k = 0;
        for (int i = 0; i < vec.size() - 1; i++){
            if (vec[i] > vec[i + 1]){
                swap(vec[i], vec[i + 1]);
            } else {
                k++;
            }
        }
    } 
}

void coctail_sort(vector<int> &vec){
    int l = 0, r = vec.size() - 1, ukazatel = 0;
    while (l < r){
        if (ukazatel == l){
            for (; ukazatel < r; ukazatel++){
                if (vec[ukazatel] > vec[ukazatel + 1]){
                    swap(vec[ukazatel], vec[ukazatel + 1]);
                }
            } 
            r--;
            ukazatel--;
        } else {
            for (; ukazatel > l; ukazatel--){
                if (vec[ukazatel] < vec[ukazatel - 1]){
                    swap(vec[ukazatel], vec[ukazatel - 1]);
                }
            } 
            l++;
            ukazatel++;
        }
    }
}

void insertion_sort(vector<int> &vec){
    for (int i = 1; i < vec.size(); i++){
        for (int j = 0; j < i; j++){
            if (vec[i] <= vec[j]){
                vec.emplace(vec.begin() + j, vec[i]);
                vec.erase(vec.begin() + i + 1);
                break;
            }
        }
    }
}

void choose_sort(vector<int> &vec){
    int minZnach, id;
    for (int i = 0; i < vec.size() - 1; i++){
        minZnach = vec[i];
        id = i;
        for (int j = i; j < vec.size(); j++){
            if (minZnach > vec[j]){
                minZnach = vec[j];
                id = j;
            }
        }
        if (id == i){
            continue;
        }
        swap(vec[id], vec[i]);
    }
}

void shell_sort(vector<int> &vec){
    int sorted = 0, shag = vec.size() / 3;
    while (shag >= 1){
        for (int povt = 0; povt < shag; povt++){
            for (int i = povt + shag; i < vec.size(); i += shag){
                for (int j = povt; j < i; j += shag){
                    if (vec[i] <= vec[j]){
                        vec.emplace(vec.begin() + j, vec[i]);
                        vec.erase(vec.begin() + i + 1);
                        break;
                    }
                }
            }
        }
        shag /= 17;
    }
    for (int i = 1; i < vec.size(); i ++){
        for (int j = 0; j < i; j ++){
            if (vec[i] <= vec[j]){
                vec.emplace(vec.begin() + j, vec[i]);
                vec.erase(vec.begin() + i + 1);
                break;
            }
        }
    }
}

void quick_sort(vector<int> &vec, int l, int r){
    if (r - l <= 1){
        return;
    }
    int opora = vec[l];
    int left = l + 1, right = r - 1, povtor = 0;
    while (true){
        while(left < vec.size() and vec[left] < opora){
            left++;
        }
        while(right > 0 and vec[right] >= opora){
            right--;
        }
        if (left >= right){
            break;
        } else {
            swap(vec[left], vec[right]);
        }
    }
    swap(vec[l], vec[left - 1]);
    quick_sort(vec, l, left - povtor);
    quick_sort(vec, left, r);
}

